:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  WILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Herbert William and MASON, Bertha Louisa Gertrude
  JWILLIAMS, Denys William Wanklyn and THOMSON, Margaret Ann
  JWILLIAMS, Margaret Anne (Peggy) and KROGH, Severin Cal
  04> WILLIAMS, Margaret Anne (Peggy) m on 13.07.1967 to KROGH, Severin Cal
  b 18.09.1931
  b 14.08.1917 d 14.08.1997
  Margaret b. at Gisborne and m, at Vancouver, Canada. Cal, s/o Severin C Krogh and Florence Hooper, b.
  at Los Angeles, California, USA and d. at Howick, Auckland. Address: 15 Galsworthy Place, Bucklands
  Beach, Auckland.
  Peggy was educated through the Correspondence School and at Woodford House. She travelled widely
  before marriage then lived and worked at Long Beach, California.
  Cal worked for Howard Hughes. He was a photographer in the US Air Force in the Pacific area during
  WW2. He later mined industrial diamonds in Guyana, the former British Guiana. He flew weather planes
  out of Panama and was an air traffic controller in Hawaii. Before retirement to New Zealand, he was a
  buyer of pharmaceuticals for Kaiser Hospital in Harbour City, California.
  05> WILLIAMS, Ralph Wanklyn m on 26.07.1958 to MCFADYEN, Margaret -Anne
  b 18.09.1931
  b 10.01.1931
  Ralph b. at Gisborne and m, at Tauranga. Margaret-Anne, d/o Frank Alexander McFadyen and Agnes Florence
  Bayley McIldowie, b. at Gisborne. Address: 13 Douglas Street, Gisborne.
  Ralph was educated at home by Correspondence School for six years then attended St George's School and
  Wanganui Collegiate School (1945-48). He farmed on "Ruangarehu" station, Te Puke, "Castle Point"
  station, Wairarapa and at Te Puia Springs before managing "Mangaroa" station near Tokomaru Bay.
  Margaret-Anne is a registered nurse.
  Mangaroa Station
  This property was purchased in 1961 by brothers William Martyn Williams, Adrian Herbert Williams and
  Ralph Wanklyn Williams and farmed in partnership under the management of Ralph. In 1969 Martyn and
  Adrian were bought out and since 1986 Ralph and his son Graeme Denys Williams have been farming the
  property in partnership.
  "Mangaroa" station currently consists of 802 ha of freehold steep hill country. Maori leasehold land
  of 324 acres was freeholded in 1967 and a further 284 acres was freeholded in 1971. The station is
  situated on Waiau Road, approx 80 km north of Gisborne and carries 400 Angus breeding cows and 2800
  Romney breeding ewes plus all replacements. Since 1961 more than 33,000 willow and poplar poles have
  been planted for erosion control.
  01> WILLIAMS, Leslie Gailm on 27.08.1982 to SAVORY, Peter John
  b 13.05.1960
  b 18.09.1959
  Leslie b. at Te Puia Springs and m. at Gisborne. Peter, s/o John Christopher Savory and Margaret
  Gillian Clarke, b. at Pahiatua. Address: 459 Gluepot Road, Oropi, RD 3, Tauranga.
  Leslie was educated at Tokomaru Bay Primary School and Iona College. In 1978-81 she completed a
  Diploma in Teaching and a Bachelor of Education at Massey University then taught in Hawkes Bay and
  Christchurch before travelling overseas. On her return she worked as a computer operator for
  Databank Systems, and as a lending officer for the National Bank in Nelson. .
  Peter was educated at Manawahe Primary School in the Bay of Plenty and at Nelson College. In
  1979-81 he completed a Bachelor of Agriculture at Massey University. He then worked for Fruitfed
  Supplies Ltd for 11 years in Christchurch, Nelson, and Auckland as irrigation designer and market
  development manager. He is now working for Watkins/Yates as Territory Manager in the commercial
  nursery sector.
  After spending four years in Auckland, Leslie and Peter moved to a lifestyle block at Pyes Pa,
  Tauranga, where Leslie is doing teacher aide work and voluntary work for special needs children.
  She is a member of the Board of Trustees for Oropi School.
  01> SAVORY, Kate Sarah
  b 12.06.1988
  Kate b. at Nelson. She started school at Hobsonville Primary and is now at Oropi Primary
  School.
